export default function ShoppingCartItemCard({ shoppingCartItem }) {
  return (
    <div className="shopping-cart-item-card">
      <img
        className="shopping-cart-item-image"
        src={shoppingCartItem.image}
        alt={shoppingCartItem.name}
      />
      <div className="shopping-cart-item-details">
        <h4>{shoppingCartItem.name}</h4>
        <p>{shoppingCartItem.price}</p>
      </div>
    </div>
  );
}
